import React from 'react';
import { NativeBaseProvider, Box } from 'native-base';
import AppNavigator from './AppNavigator';

export default function App() {
  return (
    <NativeBaseProvider>
      <Box flex={1} bg="#fff" alignItems="center" justifyContent="center">
        <AppNavigator />
      </Box>
    </NativeBaseProvider>
  );
}
